import React from "react";

const App = () => {
  return (
   <div class="mx-auto flex max-w-lg items-center space-x-4 rounded-xl bg-orange-50 p-6 shadow-lg">
    <div>
      <div class="pb-5 text-center text-sm font-medium tracking-wider text-sky-900">I AM GRATEFUL FOR:</div>
</div></div>
  );
}

export default App;
